import React, { useEffect } from "react";
import axios from "axios";
import { NavLink } from "react-router-dom";
import Nav from "./Nav";
function Profile() {
  const dataInfo = JSON.parse(localStorage.getItem("info"));

  useEffect(() => {
    (async function () {
      try {
        const res = await axios.post(
          "https://alo-server.onrender.com/api/user/data/patient/v2",
          { idAccount: dataUser.id }
        );
        localStorage.setItem("info", JSON.stringify(res.data.result));
      } catch (error) {
        console.log(error);
      }
    })();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  return (
    <>
      <div className="home-container">
        <div className="home-content">
          <div className="home-bg">
            <Nav />
            <div className="profile-container">
              {dataInfo ? (
                <div className="profile-content">
                  <h2>Thông tin</h2>
                  <div>
                    <span>Họ và tên:</span>
                    <p>{dataInfo?.fullName}</p>
                  </div>
                  <div>
                    <span>Ngày sinh:</span>
                    <p>{dataInfo?.date}</p>
                  </div>
                  <div>
                    <span>Email:</span>
                    <p>{dataInfo?.mail}</p>
                  </div>
                  <div>
                    <span>Số điện thoại:</span>
                    <p>{dataInfo?.phoneNumber}</p>
                  </div>
                  <div>
                    <span>Số bảo hiểm:</span>
                    <p>{dataInfo?.healthInsurance}</p>
                  </div>
                  <div>
                    <span>Địa chỉ:</span>
                    <p>{dataInfo?.location}</p>
                  </div>

                  <div className="btn-container">
                    <button className="btn">Sửa hồ sơ</button>
                    <button className="btn">Xoá hồ sơ</button>
                  </div>
                </div>
              ) : (
                <div className="profile-content">
                  <h2 style={{ marginBottom: "40px", fontSize: "24px" }}>
                    Bạn chưa có thông tin, vui lòng thêm thông tin !
                  </h2>
                  <div className="form-add" style={{ display: "block" }}>
                    <div>
                      <label htmlFor="">Họ và tên:</label>
                      <input type="text" placeholder="Nhập họ và tên..." />
                    </div>
                    <div>
                      <label htmlFor="">Ngày sinh:</label>
                      <input type="text" placeholder="Nhập ngày sinh..." />
                    </div>
                    <div>
                      <label htmlFor="">Email:</label>
                      <input type="text" placeholder="Nhập email..." />
                    </div>
                    <div>
                      <label htmlFor="">Số điện thoại:</label>
                      <input type="text" placeholder="Nhập số điện thoại..." />
                    </div>

                    <div>
                      <label htmlFor="">Nhập địa chỉ:</label>
                      <input type="text" placeholder="Nhập địa chỉ..." />
                    </div>
                    <div style={{ textAlign: "center" }}>
                      <button className="btn">Lưu lại</button>
                    </div>
                  </div>
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Profile;
